About:
Toy Cantando sello editorial-discografica dedicado a fortalecer todas las manifestaciones literarias y musicales del segmento infantil. 
Cubrimos diferentes tematicas, desde productos para estimular a los bebes, hasta la educacion y la ludica en la etapa preescolar y primaria; 
cuidadosamente disenados para divertir, educar y sobre todo, desarrollar en los ninos principios y valores que contribuyan a formar una sociedad mejor.
